// SPDX-License-Identifier: MIT
pragma solidity ^0.5.0;

import "./ProposalBase.sol";

contract Proposal is ProposalBase {

    struct VoterEntity {
        uint256 amount;
        uint voteItem;
        uint index;
    }

    mapping(address => VoterEntity) voterEntities;

    event Voted(address voter, uint256 amount, uint index);
    event revoked(address voter, uint256 amount, uint index);

    constructor(address _governance,
        address _pool,
        uint256 _startHeight,
        uint256 _finishHeight,
        string memory _title,
        string memory _link,
        string memory _description,
        uint256 _itemCount) public
        ProposalBase(_governance, _pool, _startHeight, _finishHeight, _title, _link, _description, _itemCount)
    {}

    function vote(uint voteItem) external updatePoolSnapshot {
        require(block.number >= startHeight && block.number <= finishHeight, "not in voting period");
        require(enableContractVote || !isSmartContract(), "smart contract can not vote");
        require(voteItem < totalVotes.length, "No such vote");
        require(insurancePool.balanceOf(msg.sender) > 0, "No voting rights");

        uint256 amount = exist(msg.sender) ? update(voteItem) : add(voteItem);
        emit Voted(msg.sender, amount, voteItem);
    }

    function revoke() external updatePoolSnapshot {
        require(block.number >= startHeight && block.number <= finishHeight, "not in voting period");
        require(exist(msg.sender), "not vote yet");
        (uint256 amount, uint voteItem) = remove();
        emit revoked(msg.sender, amount, voteItem);
    }

    function exist(address voter) public view returns (bool) {
        if(voterList.length == 0 || voterEntities[voter].index >= voterList.length) return false;
        return (voterList[voterEntities[voter].index] == voter);
    }

    function getVoteDetail(address voter) external view returns (uint256 amount, uint voteItem) {
        require(exist(voter), "not vote yet");
        return (voterEntities[voter].amount, voterEntities[voter].voteItem);
    }

    function update(uint voteItem) private returns (uint256) {
        totalVotes[voterEntities[msg.sender].voteItem] =
            totalVotes[voterEntities[msg.sender].voteItem].sub(voterEntities[msg.sender].amount);

        voterEntities[msg.sender].amount = insurancePool.balanceOf(msg.sender);
        voterEntities[msg.sender].voteItem = voteItem;
        totalVotes[voteItem] = totalVotes[voteItem].add(voterEntities[msg.sender].amount);
        return voterEntities[msg.sender].amount;
    }

    function add(uint voteItem) private returns (uint256) {
        uint index = voterList.push(msg.sender) - 1;
        voterEntities[msg.sender].amount = insurancePool.balanceOf(msg.sender);
        voterEntities[msg.sender].voteItem = voteItem;
        voterEntities[msg.sender].index = index;
        totalVotes[voteItem] = totalVotes[voteItem].add(voterEntities[msg.sender].amount);
        return voterEntities[msg.sender].amount;
    }

    function remove() private returns (uint256 amount, uint voteItem) {
        amount = voterEntities[msg.sender].amount;
        voteItem = voterEntities[msg.sender].voteItem;

        totalVotes[voteItem] = totalVotes[voteItem].sub(amount);

        if (voterList.length == 1) {
            voterList.length--;
            return (amount, voteItem);
        }
        uint rowToDelete = voterEntities[msg.sender].index;
        address keyToMove = voterList[voterList.length-1];
        voterList[rowToDelete] = keyToMove;
        voterEntities[keyToMove].index = rowToDelete;
        voterList.length--;
    }

}
